import Expense from "./components/Expense";
function App() {
  const expense = [
    {
      id: 'e1',
      title: 'tissues',
      amount: 25,
      date: new Date(2020, 4, 3),
    },
    {
      id: 'e2',
      title: 'water',
      amount: 15,
      date: new Date(2020, 7, 26),
    },
    {
      id: 'e3',
      title: 'car',
      amount: 5000,
      date: new Date(2020, 11, 24),
    },
    {
      id: 'e4',
      title: 'polish',
      amount: 25,
      date: new Date(2020, 6, 11),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expense items={expense}></Expense>
    </div>
  );
}

export default App;
